"use strict";(self.webpackChunkblksail_edu_github_io=self.webpackChunkblksail_edu_github_io||[]).push([[8130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"welcome-2025","metadata":{"permalink":"/blog/welcome-2025","editUrl":"https://github.com/blksail-edu/blksail-edu.github.io/tree/main/blog/2025-06-23-welcome.md","source":"@site/blog/2025-06-23-welcome.md","title":"Welcome AUVC 2025!","description":"Hello Trailblazers,","date":"2025-06-23T00:00:00.000Z","tags":[{"inline":true,"label":"welcome","permalink":"/blog/tags/welcome"}],"readingTime":1.4,"hasTruncateMarker":false,"authors":[{"name":"Mohamed Saad Ibn Seddik, Dr.Eng.","title":"CEO of blkSAIL","url":"https://github.com/msis","imageURL":"https://github.com/msis.png","key":"msis"}],"frontMatter":{"slug":"welcome-2025","title":"Welcome AUVC 2025!","authors":"msis","tags":["welcome"]},"unlisted":false,"nextItem":{"title":"Welcome AUVC 2023!","permalink":"/blog/hello-2023"}},"content":"Hello Trailblazers,\\n\\nWelcome to the 2025 edition of the MIT Beaver Works Summer Institute \u2013 Autonomous Underwater Vehicle Challenge, powered by  [blkSAIL](https://www.blksail.ai/) !\\n\\nYou\'re about to embark on a one-of-a-kind expedition into the thrilling world of underwater robotics. Over the next four weeks, you\u2019ll not only learn to command autonomous submarines\u2014you\u2019ll become engineers, strategists, and innovators shaping the future of marine technology.\\n\\nThis isn\'t your typical classroom experience. You\'ll be diving deep (figuratively!) into Python, C++, physics, and autonomy, using your creativity and technical skills to control real underwater robots. You\u2019ll be challenged to build, program, and fine-tune systems that can execute complex missions\u2014just like what\u2019s done in real-world marine exploration, defense, and environmental monitoring.\\n\\nExpect early wins, late-night breakthroughs, unexpected bugs, and the pure thrill of solving tough problems with your teammates. You\u2019ll be learning from industry professionals, researchers, and mentors who are just as excited as you are to explore the unknown.\\n\\nYou\u2019ve earned your place here\u2014and we\u2019re thrilled to have you. Whether you come in as a robotics enthusiast, a curious coder, a mechanical tinkerer, or simply someone who thrives on a good challenge, this course is your space to grow. Over the next few weeks, you\u2019ll sharpen your technical skills, expand your creativity, and discover just how far you can go when you combine teamwork with innovation. We\'re excited to see what you\'ll build, break, and boldly reimagine.\\n\\nThis is your launchpad. So take the plunge, get your hands dirty, make mistakes, fix them, ask questions, and most of all\u2014have fun. The ocean of knowledge is vast, and you\u2019ve just set sail.\\n\\nLet\u2019s make some waves!\\n\\nSee you in the pool,\\n\\nMohamed Saad Ibn Seddik, Dr.Eng."},{"id":"hello-2023","metadata":{"permalink":"/blog/hello-2023","editUrl":"https://github.com/blksail-edu/blksail-edu.github.io/tree/main/blog/2023-06-03-hello.md","source":"@site/blog/2023-06-03-hello.md","title":"Welcome AUVC 2023!","description":"Hello Adventurers,","date":"2023-06-03T00:00:00.000Z","tags":[{"inline":true,"label":"welcome","permalink":"/blog/tags/welcome"}],"readingTime":1.41,"hasTruncateMarker":false,"authors":[{"name":"Mohamed Saad Ibn Seddik, Dr.Eng.","title":"CEO of blkSAIL","url":"https://github.com/msis","imageURL":"https://github.com/msis.png","key":"msis"}],"frontMatter":{"slug":"hello-2023","title":"Welcome AUVC 2023!","authors":"msis","tags":["welcome"]},"unlisted":false,"prevItem":{"title":"Welcome AUVC 2025!","permalink":"/blog/welcome-2025"}},"content":"Hello Adventurers,\\n\\nWe are thrilled to welcome you to the BWSI AUVC 2023 by [blkSAIL](https://www.blksail.ai/) ! You\'re about to embark on an exciting journey into the world of underwater robotics, an adventure that will introduce you to cutting-edge technology, creative problem solving, and invaluable programming skills.\\n\\nOver the next four weeks, you\'ll be diving (metaphorically, of course) into the fascinating realm of underwater robotics. Your curiosity, creativity, and coding skills will be your tools as you learn to program and control off-the-shelf underwater robotic vehicles using Python and C++. Together, we\'ll navigate the waters of this complex and rewarding field, learning from industry professionals and guest lecturers who are true experts in their domain.\\n\\nWhether you\'re already passionate about robotics, interested in marine engineering, or just excited about learning something new, this course will provide you with a hands-on, immersive experience. By the end of the program, you\'ll be proficient in operating and controlling underwater robots, capable of planning and executing underwater missions, and well-versed in the real-world applications and challenges of underwater robotics.\\n\\nYour journey will be both challenging and rewarding. Along the way, you\'ll develop not only technical skills but also critical thinking, teamwork, and problem-solving abilities. These skills will serve you well beyond the confines of this course, in whatever academic or career paths you choose to explore in the future.\\n\\nRemember, every great journey begins with a single step. Today, you\'re taking that step. We encourage you to dive in headfirst, ask questions, and make the most of this unique experience. We\'re excited to see where this underwater adventure will take you!\\n\\nStay curious, stay excited, and most importantly, enjoy the journey!\\n\\nBest,\\n\\nMohamed Saad Ibn Seddik, Dr.Eng."}]}}')}}]);